import { createTheme } from '@mui/material/styles';

const theme = createTheme({
    palette: {
        primary: {
            main: '#302723',
        },
        secondary: {
            main: '#FAE100',
        },
        background: {
            default: '#FFFFFF',
        },
    },
    typography: {
        fontFamily: '"Nunito Sans", sans-serif',
        h1: {
            fontSize: '2rem',
            fontWeight: 700,
            color: '#464646',
        },
        body1: {
            fontSize: '1rem',
            fontWeight: 400,
        },
    },
});

export default theme;
